import React from "react";

BASE_URL = `https://pokeapi.co/api/v2/pokemon/bulbasaur`

function PokeList({ pokemon }) {
    return (
        <div className="container">
            {pokemon.map(p => (
                <div>
                    <div className="poke-div" key={p.name}>{p.name} </div>
                    <div className="poke-div" key={p.id}> <img src={BASE_URL}/></div>
                </div>
            ))}
        </div>
    )

}

export default PokeList;
